import React, { Component } from 'react'
import { OrderResult } from '../apis/datas'

const user = "1234"
class databoard extends Component {

    componentDidMount() {
        new Promise((resolve, reject) => {
            let datas = OrderResult(user)
            resolve(datas)
        })
        .then(res=>{
            console.log(res)
        })
    }
}

export default databoard
